export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},VG4zshuXAL:{data:{id:608,attributes:{imdbId:"tt0036711",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjliOTllOGQtZWRjYy00NjU3LWE5OGEtMjQ3MjM1ZmVjMGM0XkEyXkFqcGdeQXVyMjUxODE0MDY@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"78%"}],item_lang:{data:{id:1271,attributes:{title:d,plot:"Due to inclement weather, Lt. Charles Mason is forced to spend Christmas in New Orleans. Recently dumped by his girlfriend, the depressed Lieutenant falls in with Jackie Lamont, a singer who works at a nightclub and brothel. After attending midnight mass together, she tells her story to Charles. Her real name is Abigail and she fell in love with Robert Manette. After six months of happy married life, Robert is arrested for murder, but Abigail can't help loving her no-good husband.",slug:"christmas-holiday"}}},books:{data:[{id:4216,attributes:{title:d,description:"A coming-of-age novel that moves from genteel British society to the grim underworld of Paris before the war. At the age of twenty-three, Charlie Mason is endowed with good looks, good manners and a cheerful disposition. Following three years at Cambridge and one working in his father's business, he is looking forward to a jaunt in Paris with one of his oldest friends. Yet Paris is not what he expects - in just a few days his young eyes are opened to the tragedies and ugly dramas of its underworld.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DGnihbhA9Z8C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:true,published:"2009-10-06",publisher:"Random House",subtitle:a}},{id:4217,attributes:{title:"Christmas Holiday (W. Somerset Maugham) (Literary Thoughts Edition)",description:"Literary Thoughts edition presents Christmas Holiday by W. Somerset Maugham ------ \"Christmas Holiday\" is a novel written in 1939 by W. Somerset Maugham (1874-1965), just before the outbreak of World War II, and tells the story of Charley Mason, whose father granted him a trip to Paris with all expenses paid, and although it should have been a lark, on his first night Charley meets a woman whose story will forever change his life. The story was later adapted in a movie of the same name. All books of the Literary Thoughts edition have been transscribed from original prints and edited for better reading experience. Please visit our homepage www.literarythoughts.com to see our other publications.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1BnNDQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:c,published:"2016-12-27",publisher:"epubli",subtitle:a}},{id:4218,attributes:{title:d,description:"For Christmas, Charley Mason's father granted him a trip to Paris, all expenses paid. It should have been a lark, but on his first night Charley meets a woman whose story will forever change his life. For Lydia has seen tragedy. The Russian Revolution displaced her family, left her homeless, fatherless. And for reasons that elude Charley, Lydia pines for a man half a world away--a dope dealer and murderer whose sins Lydia seeks to absolve through her own self- destruction. Haunting, erotic, deeply effecting, Christmas Holiday explores two souls capsized by compassion--and the confusion that engulfed a generation in the days between the Great Wars.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wdwXEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:c,published:"2021-01-26",publisher:"eBookIt.com",subtitle:a}},{id:4219,attributes:{title:"Christmas Holiday Illustrated Edition",description:"Christmas is an annual festival commemorating the birth of Jesus Christ, observed primarily on December 25 as a religious and cultural celebration among billions of people around the world.",thumbnail:a,authors:["W. Somerset W. Somerset Maugham"],firstBook:c,published:"2021-12-30",publisher:a,subtitle:a}},{id:4220,attributes:{title:"Leben und Werk",description:"Klaus W. Jonas' zweisprachige Ausgabe behandelt die literarische Laufbahn des Schriftstellers W. Somerset Maugham (1874-1965), eines der erfolgreichsten und meistgelesenen englischen Dramatiker, Essayisten und Romanciers der ersten Halfte des 20. Jahrhunderts. Maugham selbst hat das humorvolle Vorwort in der Form eines Briefes beigesteuert. Eine chronologische Darstellung seines Lebens wird erganzt durch zwei wissenschaftliche Essays des Verfassers zu Maughams umfassendem literarischen Schaffen. Von besonderem Interesse sind die Auszuge aus dem Briefwechsel zwischen Klaus W. Jonas und W. Somerset Maugham, die einen genaueren Einblick in die Personlichkeit des Schriftstellers erlauben und von der engen Vertrautheit der beiden Briefpartner zeugen. Den zweiten Teil der Ausgabe bilden eine ausfuhrliche Bibliographie von Maughams literarischem Schaffen sowie eine Auswahlbibliographie von mehr als 420 kritischen Studien in deutscher, englischer, japanischer, spanischer und franzosischer Sprache. 71 Abbildungen, viele von ihnen bisher unveroffentlicht und aus Privatbesitz, erhohen den dokumentarischen Wert dieses Bandes. In this bilingual edition the author attempts to trace the literary career of William Somerset Maugham (1874-1865), one of the most widely read and performed dramatists, essayists and novelists in English literature in the first half of the twentieth century. Maugham himself has contributed a humorous preface in the form of a letter addressed to the author. The detailed chronology of Maugham's life is being supplemented by two of the author's numerous essays dealing with the stupendous literary oeuvre of this writer. Of special interest are the excerpts from Maugham's letters to his German-born collector and biographer which provide an inside view into his personality and his friendship with Klaus W. Jonas. The second half of this volume contains a bibliographical record of Maugham's life-work and a select bibliography of 420 critical studies in German, English, French, Spanish and Japanese. 71 illustrations, many of which hitherto unpublished and privately owned, enhance the documentary value of this volume.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dV5BeXacNxQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Klaus W. Jonas"],firstBook:c,published:"2009-01-01",publisher:"Otto Harrassowitz Verlag",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703510236}}("","movie",null,"Christmas Holiday","W. Somerset Maugham","series",1))